import React from 'react';
import Navbar from './Navbar';
import Corpo from './Corpo';
import './App.css';


const App = () => {
    return (
        <div>
            <div className='teste'>
                <Navbar></Navbar>
            </div>


            <div>
                <Corpo></Corpo>

            </div>
        </div>
    );
}

export default App;
